{"name": "create_participant_performance_report_table", "query": "
-- Create the participant_performance_report table
CREATE TABLE participant_performance_report (
    report_id SERIAL PRIMARY KEY,
    participant_id INTEGER NOT NULL CHECK (participant_id > 0),
    event_count INTEGER,
    stat_count INTEGER,
    stat_type_count INTEGER,
    last_event_date TIMESTAMP,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

COMMENT ON TABLE participant_performance_report IS 'Performance report table for participant analytics';
"}

{"name": "create_performance_optimization_indexes", "query": "
-- Index 1: Composite index on participants_events for main query and filtering
CREATE INDEX idx_participants_events_participant_event 
ON participants_events(participant_id, event_id);

-- Index 2: Composite index on stats for the correlated subqueries
-- This is crucial for the WHERE clauses in the subqueries
CREATE INDEX idx_stats_holder_type_id 
ON stats(stat_holder_type, stat_holder_id, stat_repository_type);

-- Index 3: Index on events for the last_event_date calculation
CREATE INDEX idx_events_id_start_date 
ON events(id, start_date_time);

-- Index 4: Additional index for participants_events join optimization
CREATE INDEX idx_participants_events_event_id 
ON participants_events(event_id, participant_id);

COMMENT ON INDEX idx_participants_events_participant_event IS 'Optimizes participant filtering and event lookup';
COMMENT ON INDEX idx_stats_holder_type_id IS 'Optimizes stats correlated subqueries by holder type and id';
COMMENT ON INDEX idx_events_id_start_date IS 'Optimizes event date lookup for last_event_date calculation';
COMMENT ON INDEX idx_participants_events_event_id IS 'Optimizes JOIN between events and participants_events';
"}

{"name": "add_report_table_indexes", "query": "
-- Add indexes to the report table for future query optimization
CREATE INDEX idx_report_participant_id ON participant_performance_report(participant_id);
CREATE INDEX idx_report_created_at ON participant_performance_report(created_at);
CREATE INDEX idx_report_event_count ON participant_performance_report(event_count DESC);

COMMENT ON INDEX idx_report_participant_id IS 'Optimizes lookups by participant_id';
COMMENT ON INDEX idx_report_created_at IS 'Optimizes queries filtering by report creation date';
COMMENT ON INDEX idx_report_event_count IS 'Optimizes queries ordering by event count';
